        [HttpGet]
        [Route("DownloadLargeFile")]
        public void DownloadLargeFileLocally()
        {
            string url = null,param=null;
            try
            {
            
                var req = Request.RequestUri.Query.ToString();
                param = req;

                string[] paramSplit = param.Split('?');

                string uris = paramSplit[1] +"?"+ paramSplit[2];
                url= uris.Replace("url=http://", "http://");

                var res = Request.CreateResponse(HttpStatusCode.OK);

                string GstnDomainUrl = Constants.LargeFileGstnDomain;

                var uri = new Uri(url);
                string RequestUrl = uri.Host;
                string UqueryString = uri.Query;

                var parsed = HttpUtility.ParseQueryString(UqueryString);

                string md5 = parsed["md5"];
                string expires= parsed["expires"];

                string names = url.Replace("http://"+ RequestUrl+ "/downloadLargeFile", GstnDomainUrl);

                string fileName = Path.GetFileName(names);
                string[] fileNameSplit = fileName.Split('?');

                string tarFilePath = Constants.TarFilePath;
                string tarFileFolder = Constants.TarFileFolder;

                string File_Path = tarFileFolder + "/" + fileNameSplit[0];

                string pathLocal = tarFilePath + fileNameSplit[0];

                WebClient Client = new WebClient();
                Client.QueryString.Add("md5", md5);
                Client.QueryString.Add("expires", expires);
                Client.DownloadFile(names, pathLocal);

                //var uriBuilder = new UriBuilder(url);
                //var query = HttpUtility.ParseQueryString(uriBuilder.Query);

                //query["md5"] = md5;
                //query["expires"] = expires;

                //uriBuilder.Query = query.ToString();
                //url = uriBuilder.ToString();

                HttpWebRequest request = (HttpWebRequest)WebRequest.Create(names);
                HttpWebResponse resp = (HttpWebResponse)request.GetResponse();

                HttpResponse Response = HttpContext.Current.Response;

                //string fpath = Path.GetFileName(File_Path);
                //string[] filepath = fpath.Split('?');

                Response.ClearContent();
                Response.Clear();
                Response.ContentType = "application/x-tar";
                Response.AppendHeader("Content-Disposition", "attachment; filename=" + fileNameSplit[0]);
                Response.WriteFile(File_Path);
                Response.End();

                string del = tarFilePath + fileNameSplit[0];
                File.Delete(del);


            }

            catch (Exception ex)
            {
                throw ex;
            }

        }

